import { Link } from "react-router-dom";
import NetflixLogo from '../images/Netflix-Logo.png'
import '../styles/Nav.css';

const Nav = () => {
    return (
        <nav>
            <Link to='./'>
                <div className='logoContainer'>
                    <img className='logoImg' src={NetflixLogo} alt='NetflixLogo' />
                </div>
            </Link>
            <div className='navLinks'>
                <Link to='./hiscores'><img className='hiscores' alt='Hiscores' /></Link>
            </div>
        </nav>
    );
}

export default Nav;
